webpackJsonp([88025333830971],{331:function(A,e){A.exports={data:{markdownRemark:{html:'<p>2017 turned out to be quite the year for me. Lots of big changes, and lots of attempts at living a more balanced, artful life. After spending five years at CU Boulder, I’m happy to finally be done with school forever. Academia was never my forte, and I was anxious to be done with it all. Looking back, I kinda miss those days.. and it hasn’t even been 6 months. But you always miss the days when they’re gone. It’s hard to appreciate the good times while you’re living them.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-ea265.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.2037037037037%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="old room"\n        title=""\n        src="/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-ec749.jpg"\n        srcset="/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-d894e.jpg 173w,\n/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-97c21.jpg 345w,\n/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-ec749.jpg 690w,\n/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-f7d37.jpg 1035w,\n/static/old-room-377d56ea39bcf8241cb2cb7c5e506458-ea265.jpg 1080w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>My old room. Good memories here.</em></p>\n<p>In the midst of trying to finish school on a scramble, I was desperately looking for a full time job. I had a few years of experience, so I didn’t think I’d run into trouble finding jobs. Turns out, it’s very difficult to find a job that excites you, and at the same time wants to hire you. I struggled to find that combo, and it took me precisely 43 job interviews, only 2 of which turned into legitimate offers. Now, I’m makin’ stuff at <a href="http://viget.com">Viget</a>, a full-service interactive agency that specializes in custom software and hardware. It’s been such a trip working with really talented people, and I’m excited to see where my journey with Viget leads to.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/viget-df4bb6554f14a958bef15672949dc801-ea265.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.48148148148148%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Viget React JavaScript"\n        title=""\n        src="/static/viget-df4bb6554f14a958bef15672949dc801-ec749.jpg"\n        srcset="/static/viget-df4bb6554f14a958bef15672949dc801-d894e.jpg 173w,\n/static/viget-df4bb6554f14a958bef15672949dc801-97c21.jpg 345w,\n/static/viget-df4bb6554f14a958bef15672949dc801-ec749.jpg 690w,\n/static/viget-df4bb6554f14a958bef15672949dc801-f7d37.jpg 1035w,\n/static/viget-df4bb6554f14a958bef15672949dc801-ea265.jpg 1080w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I’ve had the chance to make some really cool stuff at Viget. Technology-wise, I’m heavily exploring JavaScript and React. Those two technologies seem to have had far-reaching implications in the world of software and I’m psyched to be living at such an exciting time for programmers. A few years back when I decided that I wanted to become a web programmer, I promised myself that I would make art out of it. I’m fortunate that Viget let me do such things and let me spearhead our WebVR development.</p>\n<p>Amongst all the job hunting and academic struggles, I tried to squeeze music in there once in a while when inspiration hit, but I’ve kinda been at a wall for a very long time. All the chaos in life does amount to some relatively interesting riffs on the guitar, but I’ve never been able to take those fragments and compose them into full-fledged songs. They now live as tiny bits of music that I’ve very sporadically managed to lay down between everything else in life. Makes sense, because music has not really been a priority for me for the past few years. The pressure of school and money combined made it very easy to put music on the backburner.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sonder-7028e2b073fc85a219532655a25d8e93-a7415.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.885416666666664%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Prayash Thapa Sam Martin Piano Guitar Sonder"\n        title=""\n        src="/static/sonder-7028e2b073fc85a219532655a25d8e93-ec749.jpg"\n        srcset="/static/sonder-7028e2b073fc85a219532655a25d8e93-d894e.jpg 173w,\n/static/sonder-7028e2b073fc85a219532655a25d8e93-97c21.jpg 345w,\n/static/sonder-7028e2b073fc85a219532655a25d8e93-ec749.jpg 690w,\n/static/sonder-7028e2b073fc85a219532655a25d8e93-f7d37.jpg 1035w,\n/static/sonder-7028e2b073fc85a219532655a25d8e93-31ec7.jpg 1380w,\n/static/sonder-7028e2b073fc85a219532655a25d8e93-d9d57.jpg 2070w,\n/static/sonder-7028e2b073fc85a219532655a25d8e93-a7415.jpg 3840w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>One of the videos I did manage to make with my music buddy Sam Martin. Scope it <a href="https://www.youtube.com/watch?v=DwvlEhy5q5Y">here</a>!</em></p>\n<p>But, things are swinging back to the way they used to be. Now that I have no commitments outside of work, it’s been much easier to allocate time for music. The electro-acoustic stuff that <a href="http://soundcloud.com/effulgence">I used to upload on SoundCloud</a> is less of a priority now, and I’m honestly focusing on honing my chops on the guitar before going back to the computer. I’ve got two new videos on YouTube currently, both made by my good friend Ben Crawford. One is about <a href="https://www.youtube.com/watch?v=UHDN-TyN92U">why I do what I do</a>, and the other, <a href="https://www.youtube.com/watch?v=2PNG4Nei8CI">a 60 second fingerstyle cover of The Scientist by Coldplay</a>.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-a7415.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.25%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Prayash Thapa Fingerstyle Guitar"\n        title=""\n        src="/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-ec749.jpg"\n        srcset="/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-d894e.jpg 173w,\n/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-97c21.jpg 345w,\n/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-ec749.jpg 690w,\n/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-f7d37.jpg 1035w,\n/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-31ec7.jpg 1380w,\n/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-d9d57.jpg 2070w,\n/static/the-scientist-3dad141e93e9f06fdce5fea09c889a54-a7415.jpg 3840w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Just a nerd and his guitar in the middle of a forest in Flagstaff, Boulder. It was very cold.</em></p>\n<p>Aside from music and work, I also had the chance to travel around the states a bit more. That’s been really nice, because ever since <a href="http://prayash.io/blog/undiscovered-colors">Argentina</a>, I’ve had the itch to visit new, unfamiliar places. This year, I got to visit New Mexico, New York City, Boston, Washington DC, and Durham, NC. Not the most extensive list, but I really enjoyed them. I’m definitely looking forward to spending the next year traveling to some awesome places. It’s always really inspiring to travel to new places and come back with new inspiration. I’ve found that to be very helpful when looking for inspiration in art.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/new-mexico-022526b259377b685546e33069fbe0d1-ea265.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.48148148148148%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="New Mexico with the family"\n        title=""\n        src="/static/new-mexico-022526b259377b685546e33069fbe0d1-ec749.jpg"\n        srcset="/static/new-mexico-022526b259377b685546e33069fbe0d1-d894e.jpg 173w,\n/static/new-mexico-022526b259377b685546e33069fbe0d1-97c21.jpg 345w,\n/static/new-mexico-022526b259377b685546e33069fbe0d1-ec749.jpg 690w,\n/static/new-mexico-022526b259377b685546e33069fbe0d1-f7d37.jpg 1035w,\n/static/new-mexico-022526b259377b685546e33069fbe0d1-ea265.jpg 1080w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-01697.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100.1132502831257%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="The highlight was probably participating in a VR/AR Hackathon at the MIT Media Lab in Boston."\n        title=""\n        src="/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-ec749.jpg"\n        srcset="/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-d894e.jpg 173w,\n/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-97c21.jpg 345w,\n/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-ec749.jpg 690w,\n/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-f7d37.jpg 1035w,\n/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-31ec7.jpg 1380w,\n/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-d9d57.jpg 2070w,\n/static/mit-hackathon-d7874970e53d85810361568f9eca63d2-01697.jpg 3532w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Playing around with the Microsoft HoloLens at MIT. A revolutionary piece of technology.</em></p>\n<p>Aside from work, music and traveling, life could not be more exciting.</p>',timeToRead:4,frontmatter:{date:"December 25, 2017",title:"2017: A Year in Review"}}},pathContext:{slug:"/blog/2017"}}}});
